import React, { useState } from 'react'

const About = (props) => {

    return(
<>
    <h1 className='about-header'>About Me</h1>
    <p className='about'>I am a Carpenter based in Woodstock, Georgia. I am interested in becoming a Software Engineer.Carpentry has always been a great passion of mine. I love brainstorming ideas, creating new designs, and executing projects with different techniques and tools.</p>

    <br></br><br></br>


    <p className='about'> Throughout my time researching Software Engineering, I began to see the similarities between these two fields. Although Carpentry deals with physical projects and Software Engineering deals with digital projects, in both fields, I have the opportunity to create something new that has the potential for funtionality and to be aesthetically pleasing by using many different techniques and tools.</p>
</>
    )
}

export default About
